import React, { Component } from 'react';
import './App.css';
import {Navbar,FormGroup,Button,FormControl,Nav,NavDropdown,NavItem,MenuItem} from 'react-bootstrap';


class Header extends Component {


  render() {
    // function handleClick(e) {
    //   e.preventDefault();
    //   alert(3);
    //   console.log('The link was clicked.');
    //   console.log(e.target);   
       
    // }
    return (
      <div>
        <Navbar>
          <Navbar.Header>
            <Navbar.Brand>
              <a  href="/">Guitar 4U</a>
            </Navbar.Brand>
            <Navbar.Toggle />
          </Navbar.Header>
          <Navbar.Collapse>
            <Nav>
              <NavItem eventKey={1} href="/">
                Home
              </NavItem>
              <NavDropdown eventKey={2} title="Products" id="mydrop">
                <MenuItem eventKey={2.1} href="/product-cate-id=1">Aucostic Guitar</MenuItem>
                <MenuItem eventKey={2.2}  >Electric Guitar</MenuItem>

                <NavDropdown eventKey={2} className="dropdown-submenu " title="Products" id="basic-nav-dropdown">
                  <MenuItem eventKey={2.1} href="/product-cate-id=1">Aucostic Guitar</MenuItem>
                  <MenuItem eventKey={2.2} href="/product-cate-id=2">Classic Guitar</MenuItem>
                  <MenuItem eventKey={2.3} href="/product-cate-id=3">Electric Guitar</MenuItem>
                  <MenuItem eventKey={2.4} href="/product-cate-id=4">Bass Guitar</MenuItem>
                  <MenuItem eventKey={2.5} href="/product-cate-id=5">Ukulele</MenuItem>
                  <MenuItem divider />
                  <MenuItem eventKey={2.5}>Contact</MenuItem>
                </NavDropdown>

                <MenuItem eventKey={2.3}>Bass Guitar</MenuItem>
                <MenuItem eventKey={2.4}>Ukulele</MenuItem>
                <MenuItem divider />
                <MenuItem eventKey={2.5}>Contact</MenuItem>
              </NavDropdown>
            </Nav>
            
           
            <Nav pullRight>
              <NavItem href="#">
                Login
              </NavItem>
              <NavItem href="#">
                Sign Up
              </NavItem>
            </Nav>
            <Navbar.Form pullRight>
                <FormGroup>
                  <FormControl type="text" placeholder="Search" />
                </FormGroup>{' '}
                <Button type="submit">Submit</Button>
              </Navbar.Form>
          </Navbar.Collapse>
        </Navbar>
      </div>
    );
  }
}

export default Header;
